import React, {Component, Fragment} from "react";
import {withRouter} from "react-router";

class singuping extends Component {
    constructor() {
        super();
        this.state = {}
    }

    render() {
        return (
            <div className={"singuping"}>
                <div className={"singupingone"}><i className="el-icon-setting"></i></div>
                <div className={"singupingtwo"}>
                    <img/>
                    <span></span>
                    <img/>
                    <img/>
                    <div></div>
                    <div></div>
                    <ul>
                        <li></li>
                        <li></li>
                        <li></li>
                    </ul>
                    <div>
                        <div></div>
                        <div></div>
                        <div></div>
                        <div></div>
                    </div>
                </div>
                <div className={"singupingthree"}></div>
                <div className={"singupingthree"}></div>
                <div className={"singupingthree"}></div>
                <div className={"singupingthree"}></div>
                <div></div>
                <div></div>
                <div></div>
                <div></div>
            </div>
        )
    }

}

export default withRouter(singuping);
